import React from "react";
import Navbar from "../components/Navbar";
import FlightSearch from "../components/FlightSearch";

const FlightsPage = () => {
  const handleSearch = (params: any) => {
    console.log("Căutare inițiată:", params);
    // Integrare API ulterioară
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 via-white to-blue-100">
      <Navbar />

      <main className="flex flex-col items-center px-6 py-16 max-w-5xl mx-auto">
        <section className="bg-white bg-opacity-90 backdrop-blur-md rounded-3xl p-10 shadow-xl w-full
                            max-w-4xl transition-transform duration-300 hover:scale-[1.02]">
          <h2 className="text-4xl font-extrabold mb-8 text-center text-blue-900 drop-shadow-sm">
            Caută un zbor
          </h2>

          <FlightSearch onSearch={handleSearch} />
        </section>
      </main>

      <footer className="mt-16 text-center text-gray-500 text-sm select-none pb-8">
        © 2025 DevNebula. Toate drepturile rezervate.
      </footer>
    </div>
  );
};

export default FlightsPage;
